import React from 'react';


const colors = ["#0088FE", "00C49F", "#FFBB28"];

function Slideshow(){
    return(
        <div className="slideshow">
            <div className="slideshowSlider">
                {colors.map((backgroundColor, index) => (
                    <div classname="slide" key={index} style={{backgroundColor}}/>
                ))}

            </div>
        </div>
    )
}
